import {
    NUEVA_ETAPA, NUEVA_V_PAIS, NUEVA_V_TIPO
} from '../../types/index';

const Reducer = (state, action) => {

    switch(action.type) {
                
        case NUEVA_ETAPA:
            return {
                ...state,
                etapa: action.payload
            }

        case NUEVA_V_PAIS:
        return {
            ...state,
            v_pais: action.payload,
            v_tipo: null
        }

        case NUEVA_V_TIPO:
            return {
                ...state,
                v_tipo: action.payload
            }

        default:
            return state;
    }
}
 
export default Reducer;
